import React from "react";
import './aboutMe.css';

function AboutMe(){
    return(
        <div className="about-div">
            <div id="aboutMe">
                <div className="contenedor-1">
                    <p className="text-about-me"> Hi, my name is <strong className="strong">Joaquin</strong>,
                     I'm 20 years old and I was born in <strong className="strong">Rosario</strong>,
                     city of <strong className="strong">Argentina</strong>. Web developer since 2022, knowledge about JavaScript, HTML, CSS and React framework.
                    </p>
                </div>
            </div>
        </div>
    );
}


export default AboutMe;
